// import './Header.css';
import Navigation from '../Navigation/Navigation';

function Header() {
    return (
        <header className="header">
          <div>NewsExplorer</div>
          <Navigation isLogged={true} name="Eleseeee"/>
          <div className="header__menu-icon"></div>
        </header>
    );
}

export default Header;
